import React from 'react';
import { useHistory } from 'react-router';
import { Link } from 'react-router-dom';
const Home = () => {
    return (
        <div className="container-fluid mt-5 bg-dark text-white homeCon">
            <div className="row justify-content-center">
                
                    <Link className="btn bg-success" to="/login">
                        <img width="150" height="150" alt="login" 
                        src="https://www.elegantthemes.com/blog/wp-content/uploads/2021/03/one-click-gmail-login-for-wordpress-featured-image.jpg" />

                    </Link>
               </div>
                <div className="row">
                    <Link className="bg-primary" to="/register">
                        <img width="150" height="150" alt="register" 
                        src="https://miro.medium.com/max/498/1*Es2vCEieszU7QQqsLChl6A.png" />
                    </Link>
                </div>
            
        </div>
    )
}

export default Home;
